import { Component } from "react";

class App extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      contacts: [],
    };
  }

  render() {
    return (
      <div className="App">
        <form>
          <input name="name" value="" required placeholder="Write name user" />
          <button type="submit">Button</button>
        </form>
      </div>
    );
  }
}

export default App;

